import React from 'react'
import { useParams } from 'react-router-dom'
import { Link } from "react-router-dom";

const Andalucia = () => {

    
    console.log(useParams );
    const {COM} = useParams()


    const [geoapi2, setgeoapi2] = React.useState([]);
    
  React.useEffect(() => {

    const obtenerApi = async () => {
        const dato = await fetch(`https://apiv1.geoapi.es/provincias?CCOM=${COM}01&type=JSON&key=&sandbox=1`)
        const user = await dato.json()
        console.log(user)
        setgeoapi2(user.data)
    }
    obtenerApi()

  }, []);




    return(
      <div>       
 
  
                   <h2>{geoapi2.data}</h2>         
                  <h3>{geoapi2.COM}</h3>             

  
</div>
    )
}

export default Andalucia
